import React from 'react';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import './bootstrap.min.css';
import './index.css';
import Leaderboard from './components/leaderboard';
import QuizListTable from './components/QuizListTable'; 
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <main className="center">
          <h2>Welcome to the Quiz Application</h2>
          <p>This quiz application built with React.</p>
        </main>
        <Routes>
          <Route path="/" element={
            <>
              <div className="container">
                <h1>Quiz List</h1>
                <p>Here are the quizzes available:</p>
                <QuizListTable />
              </div>
              <div className="container">
                <h1>Leaderboard</h1>
                <p>Here are the top scores:</p>
                <Leaderboard />
              </div>
            </>
          } />
        </Routes>
        <footer>
          <p>&copy; 2025 Quiz Application</p>
        </footer>
      </Router>
    </div>
  );
}

export default App;
